import React, { Component } from 'react'
import { GoogleMap, withScriptjs, withGoogleMap } from 'react-google-maps'

function Map(){
  return (
    <GoogleMap defaultZoom={10}
            defaultCenter={{lat: 45.421532, lng: -79.697189}}/>
  )
}

const WrapperMap = withScriptjs(withGoogleMap(Map));

export default class Dashboard extends Component {
  render() {
    return (
      <div  class="bg-primary mx-4 mt-4">
        <div class="row">
          <div class="col-2 bg-dark">Col1</div>
          <div class="col-10">
            <WrapperMap googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyD3kvQvdXzZ5BVGzacfSkjvFlsWqMK14Us`}
            loadingElement={<div style={{ height: `100%` }} />}
            containerElement={<div style={{ height: `100%` }} />}
            mapElement={<div style={{ height: `100%` }} />} />
            </div>
        </div>
      </div>
    )
  }
}
